import React, { useState } from "react";
import "../styles/Projects.css";

export default function Projects() {
  const [projects] = useState([
    { id: 1, name: "Website Design", price: 50 },
    { id: 2, name: "Mobile App", price: 100 },
    { id: 3, name: "Logo Design", price: 30 },
    { id: 4, name: "E-commerce Platform", price: 150 },
    { id: 5, name: "Social Media Banner", price: 25 },
  ]);

  const handleSelect = (project) => {
    alert(`You selected ${project.name}!`);
  };

  return (
    <div className="page-container projects-container">
      <div className="hero-content">
        <h1>Choose Your Next Project</h1>
        <p>Pick the project that fits your skills and start earning!</p>
      </div>
      <div className="projects-list">
        {projects.map((project) => (
          <div className="project-card" key={project.id}>
            <h3>{project.name}</h3>
            <p>Price: ${project.price}</p>
            <button onClick={() => handleSelect(project)}>Select & Start</button>
          </div>
        ))}
      </div>
    </div>
  );
}
